function WeekCheckForm({ weekCheck, setWeekCheck, week, handleWeekCheck }) {

    return (
        <div className="flex mt-7 ml-9">
            {week.map((data, i) =>
                <div className="p-2" key={i}>
                    <input
                        type='checkbox'
                        id={data}
                        onClick={handleWeekCheck}
                    />
                    <label htmlFor={data}>{data}</label>
                </div>
            )}
        </div>
    )
}

export default WeekCheckForm;
